import Row from "./Row";
const styles = {
  pagesNumber: {
    listStyle: "none",
    display: "flex",
    color: "blue",
    userSelect: "none",
    cursor: "pointer",
  }
};
export default function Table({ items, renderHeader, renderPageNumbers, onClickRow }) {
  return (
    <>
    <table>
      {renderHeader()}
      <tbody>
        {items.map(item => (
          <Row human={item} id={number} key={`${item.id}:${item.firstName}-${item.lastName}`} onClick={onClickRow}/>
        ))}
      </tbody>
    </table>
    <ul style={styles.pagesNumber}>
              {renderPageNumbers}
            </ul>
</>
  );
}
